#[test]
fn check_get_arithmetic_result_between_vectors() {
    let vec1 = vec![4.8, -2., 2.5, 6.9, 1.1000000000000005];
    let vec2 = vec![3.4000000000000004, -2.0, -0.2999999999999998, 4.8, -2.0999999999999996];
    let sum = get_arithmetic_result_between_vectors( &vec1, &vec2, |a , b| a + b);
    let mul = get_arithmetic_result_between_vectors( &vec1, &vec2, |a , b| a * b);
    let div = get_arithmetic_result_between_vectors( &vec1, &vec2, |a , b| a / b);
    let sub = get_arithmetic_result_between_vectors( &vec1, &vec2, |a , b| a - b);

    assert_eq!(vec_compare(&vec![8.2, -4., 2.2, 11.7, -1.0], &sum), true);
    assert_eq!(vec![1.3999999999999995, 0.0, 2.8, 2.1000000000000005, 3.2], sub);
    assert_eq!(vec![16.32, 4.0, -0.7499999999999996, 33.12, -2.310000000000001], mul);
    assert_eq!(vec![1.4117647058823528, 1.0, -8.333333333333337, 1.4375000000000002, -0.5238095238095242], div);
}

