#[test]
fn check_normalize_matrix_row() {
    let mut temp_points = vec![];
    temp_points.push(vec![1., 2., 3.,]);
    temp_points.push(vec![4., 5., 6.]);
    temp_points.push(vec![7., 8., 10.]);

    for row_index in 0..temp_points.len()
    {
        let conversion_row = &mut temp_points[row_index];
        Hyperplane::normalize_matrix_row(&row_index, conversion_row);
    }

    let mut answer = vec![];
    answer.push(vec![1., 2., 3.,]);
    answer.push(vec![0.8, 1., 1.2]);
    answer.push(vec![0.7, 0.8, 1.]);

    for row_index in 0..answer.len()
    {
        assert_eq!(vec_compare(&answer[row_index], &temp_points[row_index]), true);
    }
}

#[test]
