#[test]
fn deep_test_calc_perpendicular_distance()
{
    let n = test_helpers::get_n_for_deep_test();
    let niches = test_helpers::get_ref_dirs_for_deep_test();
    let ref_dirs = niches.clone();
    let u = np_tile(&ref_dirs, n.len());
    assert_eq!(u, test_helpers::get_u_for_deep_test());
    let v = np_repeat_zero_axis(&n, ref_dirs.len());
    assert_eq!(v, test_helpers::get_v_for_deep_test());
    let normalized_u = normalize_matrix_by_axis_one(&u);
    assert_eq!(normalized_u, test_helpers::get_norm_u_for_deep_test());
    let vu = multiply_matrix_rows(&v, &u);
    assert_eq!(vu, test_helpers::get_vu_for_deep_test());
    let sum_vu = sum_of_matrix_axis_one(&vu);
    assert_eq!(sum_vu, test_helpers::get_sum_vu_for_deep_test());
    let scalar_proj = divide_vectors(&sum_vu, &normalized_u);
    assert_eq!(scalar_proj, test_helpers::get_scalar_proj_for_deep_test());
    let rised_scalar_proj = rise_vector_shape(&scalar_proj);
    assert_eq!(rised_scalar_proj, test_helpers::get_rised_scalar_proj_for_deep_test());

    let rised_scalar_proj_mult_u = multiply_matrix_by_rised_vector(&u, &rised_scalar_proj);
    assert_eq!(rised_scalar_proj_mult_u, test_helpers::get_rised_scalar_proj_mult_u_for_deep_test())

    //todo da pohui
}

#[test]
fn test_hyperplane_form_extreme_points() {
    let hyperplane = Hyperplane::new(&3);
    let points = test_helpers::form_points_to_hyperplane_test();
    let weights = Hyperplane::eye(&points[0].len(), Some(1.), Some(1e6)).clone();
    assert_eq!(weights, test_helpers::form_weights_to_hyperplane_test());
    let mut preprocessed_points = vec![];
    for point in points.iter()
    {
        preprocessed_points.push(point);
    }
    let mut translated_objective: Vec<Vec<f64>> = vec![];
    for point in preprocessed_points
    {
        translated_objective.push(get_arithmetic_result_between_vectors(
            point,
            &test_helpers::get_ideal_point_to_hyperplane_test(),
            |a, b| if (a - b) > 1e-3 { a-b } else { 0. }))
    }
    assert_eq!(translated_objective, test_helpers::get_next__f_to_hyperplane_test());
    let rised_weights = rise_matrix_shape(&weights);
    assert_eq!(rised_weights, test_helpers::get_rised_weights_to_hyperplane_test());
    let mult_f_by_rised_weights = multiply_2d_matrix_and_rised_2d_matrix(&translated_objective, &rised_weights);
    assert_eq!(mult_f_by_rised_weights, test_helpers::get_mult_f_by_rised_weights_to_hyperplane_test());
    let max_of_rised_weight = np_max_axis_two_for_3d_matrix(&mult_f_by_rised_weights);
    assert_eq!(max_of_rised_weight, test_helpers::get_f_asf_to_hyperplane_test());
    let indicies_of_min_in_rows = np_argmin_axis_one(&max_of_rised_weight);
    assert_eq!(indicies_of_min_in_rows, test_helpers::get_i_to_hyperplane_test());
    let mut extreme_points = vec![];

    for index in indicies_of_min_in_rows
    {
        extreme_points.push(points[index].clone());
    }
    assert_eq!(extreme_points, test_helpers::get_extreme_points_to_hyperplane_test())
}

#[test]
fn test_niching() {
    let mut survivors = vec![];
    let pop_size = 14;
    let mut mask = vec![true; pop_size];
    assert_eq!(mask, test_helpers::get_mask_to_niching_test());
    let n_remaining = 7;
    let niche_of_individuals = test_helpers::get_niche_of_individuals_to_niching_test();
    let mut niche_count = test_helpers::get_niche_count_to_niching_test();
    let dist_to_niche = test_helpers::get_dist_to_niche_to_niching_test();


    while survivors.len() < n_remaining
    {
        let mut n_select = n_remaining - survivors.len();
        assert_eq!(n_select, test_helpers::get_n_select_to_niching_test());

        let next_niches_list = test_helpers::get_next_niches_list_to_niching_test();
        // assert_eq!(next_niches_list, test_helpers::get_next_niches_list_to_niching_test());

        let next_niche_count: Vec<usize> = next_niches_list.iter().map(|index| niche_count[*index]).collect();
        assert_eq!(next_niche_count, test_helpers::get_next_niche_count_to_niching_test());


        let min_niches_count = next_niche_count.iter().min().unwrap();
        assert_eq!(*min_niches_count, test_helpers::get_min_niche_count_to_niching_test());


        let min_niches_indicies: Vec<usize> = get_indicies_of_val(&next_niche_count, min_niches_count);
        assert_eq!(min_niches_indicies, test_helpers::get_tmp_nich_to_niching_test());

        let mut next_niches: Vec<usize> = min_niches_indicies.iter().map(|index| next_niches_list[*index]).collect();
        assert_eq!(next_niches, test_helpers::get_next_niches_to_niching_test());

        let permutation = test_helpers::get_permutation_to_niching_test();

        next_niches = permutation.iter().map(|index| next_niches[*index]).collect();
        assert_eq!(next_niches, test_helpers::get_next_niches_v2_to_niching_test());

        for next_niche in next_niches
        {
            // let mut rng = thread_rng();
            let mut next_indicies = get_next_niche_index(&niche_of_individuals, &next_niche, &mask);
            let mut next_index;
            // next_indicies.shuffle(&mut rng);
            if niche_count[next_niche] == 0
            {
                let dist_to_niches =  next_indicies.iter().map(|index|dist_to_niche[*index]).collect::<Vec<f64>>();
                let min_dist_to_niche_index = np_argmin_vector(&dist_to_niches);
                next_index = next_indicies[min_dist_to_niche_index];
            }
            else
            {
                next_index = next_indicies[0];
            }
            assert_eq!(next_index, test_helpers::get_next_ind_by_n_step_to_niching_test(next_niche));
            mask[next_index] = false;
            assert_eq!(mask, test_helpers::get_mask_by_n_step_to_niching_test(next_niche));
            survivors.push(next_index);
            assert_eq!(survivors, test_helpers::get_survivors_by_n_step_to_niching_test(next_niche));
            niche_count[next_niche] += 1;
            assert_eq!(niche_count, test_helpers::get_niche_count_by_n_step_to_niching_test(next_niche));
        }
    }
    assert_eq!(survivors, test_helpers::get_survivours_to_niching_test());

}
